	@RequestMapping(value = "/DataProcessService.svc/jsAccessEP/GetTrustData")
	@ResponseBody
	public List<Map<String, Object>>  GetTrustData(@RequestParam(name= "applicationDomain") String applicationDomain,@RequestParam(name= "contextInfo") String contextInfo){      
		logger.info("GetTrustData-------applicationDomain："+applicationDomain+" contextInfo:"+contextInfo);
		
		GetTrustDataReq req=FastJsonUtils.getJsonToBean(contextInfo, GetTrustDataReq.class);
		String SPName=req.getSPName();
		Map< String , Object> params=new HashMap<String, Object>();
		
		params.put("AliasSetName","zh-CN" );//默认获取的是中文相关信息
		
		List<Map<String, Object>>  list =trustManagementService.CommonExecuteGet(applicationDomain, SPName, params);//调用公共的方法
		
		//List<Map<String, Object>>  list = trustManagementService.GetAllCodeDictionaryMap("zh-CN"); 
		logger.info("GetTrustData----/DataProcessService.svc/jsAccessEP/GetTrustData----:applicationDomain:"+applicationDomain+"---contextInfo:"+contextInfo);
        return list;
	}
